// src/ProfilePage.js
import React, { useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
  const [activeMenu, setActiveMenu] = useState('My Programs'); // Default menu option

  const handleMenuClick = (menu) => {
    setActiveMenu(menu); // Set active menu when a menu item is clicked
  };

  const renderContent = () => {
    switch (activeMenu) {
      case 'My Programs':
        return (
          <div className="programs">
            <img src="/path/to/v1.jpg" alt="Program 1" />
            <img src="/path/to/v2.jpg" alt="Program 2" />
            <img src="/path/to/v3.jpg" alt="Program 3" />
          </div>
        );
      case 'Your Profile':
        return <div>Your Profile Content</div>;
      case 'My Diet Plans':
        return <div>My Diet Plans Content</div>;
      case 'My Articles':
        return <div>My Articles Content</div>;
      case 'My Medical History':
        return <div>My Medical History Content</div>;
      case 'My Progress':
        return <div>My Progress Content</div>;
      case 'My Trainer':
        return <div>My Trainer Content</div>;
      case 'My Subscription':
        return <div>My Subscription Content</div>;
      default:
        return <div>My Programs Content</div>;
    }
  };

  return (
    <div className="profile-page">
      <div className="sidebar">
        <div className="profile-image-container">
          <img src="/path/to/p.jpg" alt="Profile" className="profile-image" />
        </div>
        <ul>
          <li onClick={() => handleMenuClick('Your Profile')}>Your Profile</li>
          <li onClick={() => handleMenuClick('My Programs')}>My Programs</li>
          <li onClick={() => handleMenuClick('My Diet Plans')}>My Diet Plans</li>
          <li onClick={() => handleMenuClick('My Articles')}>My Articles</li>
          <li onClick={() => handleMenuClick('My Medical History')}>My Medical History</li>
          <li onClick={() => handleMenuClick('My Progress')}>My Progress</li>
          <li onClick={() => handleMenuClick('My Trainer')}>My Trainer</li>
          <li onClick={() => handleMenuClick('My Subscription')}>My Subscription</li>
        </ul>
      </div>
      <div className="content">
        <div className="hamburger" onClick={() => handleMenuClick(activeMenu)}>
          &#9776;
        </div>
        {renderContent()}
      </div>
    </div>
  );
};

export default ProfilePage;
